import React from "react";
import acm from "./images/acm.jfif";
import Card from "./Card";
import Sdata from "./Sdata";
function Clubs() {
  return (
    <div className="container">
        <h1 className="text-center a">SVNIT's Student Chapters</h1>
      <div class="row">

          {
            Sdata.map((val,ind)=>{
                return <Card 
                imgsrc={val.imgsrc}
                title={val.title}
                />
            })
          }
        </div>
      </div>
  );
}
export default Clubs;
